// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract EtherTransfer {

    address public receiver;

    // Constructor that sets the initial receiver address
    constructor(address _receiver) {
        receiver = _receiver;
    }

    // Function to set a new receiver address
    function setReceiver(address _receiver) public {
        receiver = _receiver;
    }

    // Function to transfer Ether to the receiver
    function transferEther() public payable {
        require(msg.value > 0, "Amount must be greater than 0");
        payable(receiver).transfer(msg.value);  // Transfers Ether to the receiver
    }

    // Function to retrieve the current receiver's address
    function getReceiver() public view returns (address) {
        return receiver;
    }
}
